import React from 'react';

function Footer() {
  return (
    <footer style={{ padding: '20px', backgroundColor: '#f2f2f2', marginTop: '20px', textAlign: 'center' }}>
      <p>&copy; 2023 Budget Brilliance. All rights reserved.</p>
    </footer>
  );
}

export default Footer;
